let data = datas.data;
let allNode = {};
console.log(allNode)
data.map((val, idx) => {
    val.child_tables = val.child_tables || []
    val.parent_tables = val.parent_tables || []
    let node = [val.table, ...val.child_tables, ...val.parent_tables]
    node.map((v, i) => {
        !allNode[v] && (allNode[v] = idx + '+' + i)
    })
})

grap = {
    link: [],
    node: []
}
for (let key in allNode) {
    grap.node.push({
        itemStyle: null,
        symbolSize: 10,
        value: 10,
        category: 0,
        id: allNode[key],
        name: key,
        // Use random x, y
        x: null,
        y: null,
        draggable: true
    })
}
data.map((val,idx)=>{
    if(!val.child_tables
        &&
        !val.parent_tables){
        grap.link.push({
            id: idx,
            lineStyle: {normal: {}},
            name: null,
            source: allNode[val.table],
            target: allNode[val.table]
        })
    }
    if(val.child_tables){
        val.child_tables.map((v,i)=>{
            grap.link.push({
                id: idx+'-'+i,
                lineStyle: {normal: {}},
                name: null,
                source: allNode[val.table],
                target: allNode[v]
            })
        })
    }
    if(val.parent_tables){
        val.parent_tables.map((v,i)=>{
            grap.link.push({
                id: idx+'+'+i,
                lineStyle: {normal: {}},
                name: null,
                source:allNode[v],
                target:  allNode[val.table]

            })
        })
    }
    
})

